<center>
<br>Fred Perry フレッドペリー 正規販売店
<br>
<br>FRED PERRY ( フレッド・ペリー ）の
<br>ジョージコックスレザータッセルローファーです。
<br>
<br>ノーザンプトンのシューメーカー
<br>George Cox（ジョージコックス）との
<br>コラボレーションアイテム。
<br>カラーは深みのある上品なオックスブラッドを採用。
<br>ジョージコックスの伝統的なラバーソールに
<br>フレッドペリーのオリジナルアッパーを
<br>組み合わせたタッセルローファー。
<br>ジョージコックスの定番モデルの
<br>タッセルローファーは
<br>細身のラストを使用し、フィット感を向上させた
<br>シャープな仕上がりとなっています。
<br>
<br>デニムジーンズやチノパンなど、
<br>どんなパンツにも合わせやすい。
<br>作りもしっかりとしていて、
<br>長く愛用して頂けるアイテムです。 
<br>高級感溢れるデザインや作りが
<br>ギフトとしても喜ばれること間違いなし。
<br>インソールにはジョージコックスと
<br>フレッドペリーの刻印が入った
<br>特別仕様となっています。
